```sql
SELECT
  CONCAT(
    (
      MAX(CASE WHEN reasondescription = 'Resolved' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'Resolved' THEN (',') ELSE ('') END
      )
    ),
    (
      MAX(CASE WHEN reasondescription = 'Partially resolved' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'Partially resolved' THEN (',') ELSE ('') END
      )
    ),
    (
      MAX(CASE WHEN reasondescription = 'improved' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'improved' THEN (',') ELSE ('') END
      )
    ),
    (
      MAX(CASE WHEN reasondescription = 'No Change' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'No Change' THEN (',') ELSE ('') END
      )
    ),
    (
      MAX(CASE WHEN reasondescription = 'Worsened' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'Worsened' THEN (',') ELSE ('') END
      )
    ),
    (
      MAX(CASE WHEN reasondescription = 'New' THEN ('1') ELSE ('0') END) || MAX(
        CASE WHEN reasondescription = 'New' THEN (',') ELSE ('') END
      )
    )
  ) AS chances
FROM allergies
GROUP BY
  patient;
```

